// Dijkstra's algorithm implementation
function dijkstra(graph, startNode, endNode) {
    const distances = {};
    const previous = {};
    const unvisited = new Set();

    for (let node in graph) {
        distances[node] = Infinity;
        unvisited.add(node);
    }
    distances[startNode] = 0;

    while (unvisited.size > 0) {
        let current = null;
        let minDistance = Infinity;
        for (let node of unvisited) {
            if (distances[node] < minDistance) {
                minDistance = distances[node];
                current = node;
            }
        }

        if (current === null || distances[current] === Infinity) break;
        if (current === endNode) break;

        unvisited.delete(current);

        for (let neighbor in graph[current]) {
            if (!unvisited.has(neighbor)) continue;
            let distance = distances[current] + graph[current][neighbor];
            if (distance < distances[neighbor]) {
                distances[neighbor] = distance;
                previous[neighbor] = current;
            }
        }
    }

    const path = [];
    let current = endNode;
    while (previous[current]) {
        path.unshift(current);
        current = previous[current];
    }
    if (distances[endNode] !== Infinity) path.unshift(startNode);

    return { path, distance: distances[endNode] };
}

// Form event handler
document.getElementById("path-form").addEventListener("submit", function(e) {
    e.preventDefault();

    const start = document.getElementById("start-point").value.trim();
    const end = document.getElementById("end-point").value.trim();
    const outputSection = document.querySelector(".output-section");
    const pathOutput = document.getElementById("path-output");

    if (!nodes[start] || !nodes[end]) {
        pathOutput.innerHTML = `<p style="color: red;">Invalid location names. Please check the available locations.</p>`;
        outputSection.style.display = "block";
        return;
    }

    const result = dijkstra(graph, start, end);

    if (result.path.length > 0) {
        const distanceInMeters = result.distance;
        pathOutput.innerHTML = `
            <p><strong>Shortest Path:</strong> ${result.path.join("  ")}</p>
            <p><strong>Total Distance:</strong> ${Math.round(distanceInMeters)} meters</p>
        `;
    } else {
        pathOutput.innerHTML = `<p style="color: red;">No path found between ${start} and ${end}.</p>`;
    }
    outputSection.style.display = "block"; // Ensure the results section is shown
});

